import {useState} from 'react';
import { Link } from 'react-router-dom';

function NavigationBar() {
	return (
		<div >
			<Link to="/predvidiCenu" className="stavka">Predvidite cenu</Link>
			<Link to ="/proceniNekretninu" className="stavka">Procenite nekretninu</Link>
		</div>		
	);
}

export default NavigationBar;
